lons_from_numpy = np.arange(-77.75, -36.75 + 0.5, 0.5)

# Get coordinates from config
config = ConfigFile.Instance()
lats = np.arange(config.get('spatial_domain').get('crc_sas_grid').get('sla'),
                 config.get('spatial_domain').get('crc_sas_grid').get('nla') + 0.5,
                 0.5)
lons = np.arange(config.get('spatial_domain').get('crc_sas_grid').get('wlo'),
                 config.get('spatial_domain').get('crc_sas_grid').get('elo') + 0.5,
                 0.5)

# Make grid
xx, yy = np.meshgrid(lons, lats)
xc = xx.flatten()
yc = yy.flatten()

# Now convert these points to geo-data
pts = gpd.GeoSeries([Point(x, y) for x, y in zip(xc, yc)])

# Get shape-file indicating land
shp_folder = config.get('folders').get('raw_data').get('shapefiles')
land_bound = gpd.GeoDataFrame.from_file(os.path.join(shp_folder, 'CRC_SAS.shp'))

# create progress bar to track grid generation
run_status = f'Generating points (PID: {os.getpid()})'
pb = SecondaryProgressBar(len(pts), run_status)

# open progress bar
pb.open()

in_map: List[bool] = []
for i, p in enumerate(pts):
    in_map.append(True) if any([p.within(geom) for geom in land_bound.geometry]) else in_map.append(False)
    pb.report_advance(1)

# close progress bar
pb.close()

# Select only the points in land
start = time()
in_map = np.array([pts.within(geom) for geom in land_bound.geometry]).sum(axis=0)
print(time() - start)
pts_crc = gpd.GeoSeries([val for pos, val in enumerate(pts) if in_map[pos]])

# Plot to make sure it makes sense:
